import { addToken } from "./shape-helpers/addToken";
export const ip6Prefix = (...groups) => {
    const empty = addToken("string");
    let count = 4 - groups.length;
    let fillIn = [];
    for (let index = 0; index < count; index++) {
        fillIn.push(empty);
    }
    return [
        "<<string::",
        [
            groups.join(":"),
            fillIn.join(":"),
        ].join(":"),
        ">>"
    ].join("");
};
